import React from 'react';

const BorderSection = () => {
  return (
    <div className="nv-section">
      <div className="nv-container-custom">
        <div className="nv-h--medium mb-3">Border Example</div>
        <p className="nv-text-large mb-5">This is a box with a #CCCCCC border, following NVIDIA layout and spacing.</p>
        <div style={{ border: '2px solid #CCCCCC', borderRadius: '4px', padding: '2rem', background: '#fff', maxWidth: '500px', margin: '0 auto' }}>
          <p className="nv-text-medium">This box has a #CCCCCC border.</p>
        </div>
      </div>
    </div>
  );
};

export default BorderSection;
